import React, { Component } from 'react';

class Dashboard extends Component {
    constructor(props) {
        super(props);
        this.state = {
            logged_in: false
        }
    }
    componentDidMount() {
        if (!this.state.logged_in) {
            console.log("not logged in")
        }
    }

    render(){
        return (
            <span>hello world</span>
        )
    }
}

export default Dashboard;
